import React, { useEffect, useState } from "react";

export default function Book() {
  const [books, setBooks] = useState([]);
  const [authors, setAuthors] = useState([]);
  const [categories, setCategories] = useState([]);
  const [form, setForm] = useState({
    title: "",
    authorId: "",
    categoryId: "",
    description: "",
  });

  useEffect(() => {
    fetch("http://localhost:3001/books")
    fetch("http://localhost:3001/authors").then(res => res.json()).then(setAuthors);
    fetch("http://localhost:3001/categories").then(res => res.json()).then(setCategories);
    loadBooks();
  }, []);

  const loadBooks = () => {
    fetch("http://localhost:3001/books").then(res => res.json()).then(setBooks);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    await fetch("http://localhost:3001/books", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(form),
    });
    setForm({ title: "", authorId: "", categoryId: "", description: "" });
    loadBooks();
  };

  const handleDelete = async (id) => {
    await fetch(`http://localhost:3001/books/${id}`, { method: "DELETE" });
    loadBooks();
  };

  const findName = (arr, id) => arr.find(a => a.id === id)?.name || "‚Äî";

  return (
    <div className="container">
      <h1>üìö Library Books</h1>
      <form onSubmit={handleSubmit}>
        <input
          placeholder="Book title"
          value={form.title}
          onChange={(e) => setForm({ ...form, title: e.target.value })}
          required
        />
        <select
          value={form.authorId}
          onChange={(e) => setForm({ ...form, authorId: parseInt(e.target.value) })}
          required
        >
          <option value="">Select author</option>
          {authors.map((a) => (
            <option key={a.id} value={a.id}>{a.name}</option>
          ))}
        </select>
        <select
          value={form.categoryId}
          onChange={(e) => setForm({ ...form, categoryId: parseInt(e.target.value) })}
          required
        >
          <option value="">Select category</option>
          {categories.map((c) => (
            <option key={c.id} value={c.id}>{c.name}</option>
          ))}
        </select>
        <input
          placeholder="Description"
          value={form.description}
          onChange={(e) => setForm({ ...form, description: e.target.value })}
        />
        <button type="submit">Add</button>
      </form>

      <table>
        <thead>
          <tr>
            <th>Title</th>
            <th>Author</th>
            <th>Category</th>
            <th>Description</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {books.map((b) => (
            <tr key={b.id}>
              <td>{b.title}</td>
              <td>{findName(authors, b.authorId)}</td>
              <td>{findName(categories, b.categoryId)}</td>
              <td>{b.description}</td>
              <td>
                <button onClick={() => handleDelete(b.id)}>üóëÔ∏è</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
